                            $("<input>").addClass("form-group hidden").attr({ type: "text", name: "txtIdCategoriaFaixa", value: categoriaFaixa.val() }).appendTo("table > tbody > #tr-" + idFiliado + "-" + modalidadeId + " > .last");
